import { Avatar, Divider } from "antd";
import "../style/user.css";
import {
  TwitterOutlined,
  FacebookOutlined,
  LinkedinOutlined,
} from "@ant-design/icons";

const User = () => {
  return (
    <div className="user-div comm-box">
      <div>
        <Avatar
          size={100}
          src="https://image.flaticon.com/icons/svg/2371/2371611.svg"
        />
      </div>
      <div className="user-introduction">
        With a logged in account, You can easily apply for a supporting program
        if you are qualified for it! You can apply to be a volunteer to help
        others in need! You can share this site to your friends if you find
        something useful!
        <Divider>Social Media</Divider>
        <Avatar size={28} icon={<TwitterOutlined />} className="account" />
        <Avatar size={28} icon={<FacebookOutlined />} className="account" />
        <Avatar size={28} icon={<LinkedinOutlined />} className="account" />
      </div>
    </div>
  );
};

export default User;
